    private setHealth(value: number){
        this.health = Phaser.Math.Clamp(value,0,100);

        events.emit('health-changed', this.health);
        this.scene.sound.play(`hurt${Math.floor(Math.random()*3)+1}`);

        if(this.health <= 0){
            this.stateMachine.setState('dead');
        }
    }

